function flasher() {
  $(".flash").delay(800).slideDown();
}

function closeFlash() {
  $(".close").click(function () {
    $(this).parents().find(".flash").slideUp();
  });
}

function togglePane() {
  $(".toggle-pane").click(function (e) {
    $(this).siblings(".content-pane").slideToggle();
    e.preventDefault();
  });
}

$(document).ready(function () {
  //enable svg fallback for ie 9-11
  svg4everybody();

  flasher();
  closeFlash();
  togglePane();
  smoothScroll.init({
    easing: 'easeInOutQuint'
  });

  window.Hassle.disableHandlersOnClick();
  window.h2.newsletter_modal.init();
  window.h2.become_cleaner_flash.init();

  if (window.h2.newsletter_tracking) {
    window.h2.newsletter_tracking.init();
  }

  (new WOW()).init();

  $('[data-toggle="tooltip"]').tooltip({
    placement: function (context, source) {
      var position = $(source).position();
      var originalPlacement = this.$element.data('placement');

      if (position[originalPlacement] > 200) {
        return originalPlacement;
      }

      return 'top';
    }
  });

  // Mobile Safari - workaround for tool-tipped inputs requiring two taps to gain focus
  $('input[data-toggle="tooltip"]').on('touchend', function(e) {
    $(this).focus();
  });

  $('.tool-tipped').tooltip({delay: {show: 1300, hide: 200}});
});
